c1or2 = c1or*c1or
c1or7 = c1or2*c1or2*c1or2*c1or
Stor = bb*rr
Stoe = Exp(-Stor)
Sto  = 1.d0
Aux = Stor 
Do i=1, 6
  Sto = Sto + Aux/Fact(i)
  Aux = Aux*Stor
Enddo
F6 = 1.d0 - Stoe*Sto
Do i=7, 8
  Sto = Sto + Aux/Fact(i)
  Aux = Aux*Stor
Enddo
F8 = 1.d0 - Stoe*Sto
Do i=9, 10
  Sto = Sto + Aux/Fact(i)
  Aux = Aux*Stor
Enddo
F10 = 1.d0 - Stoe*Sto
Aux = -bb*AA*Stoe + (6.d0*C6*F6 + (8.d0*C8*F8 + 10.d0*C10*F10*c1or2)*c1or2)*c1or7      &
    -  bb*Stoe*(b6*C6/Fact(6) + b8*C8/Fact(8) + b10*C10/fact(10))
drV_Xe_Xe = Aux*Hartree_to_K/rbohr
Return
End
