Double Precision Function V_der_CsXe_gs(xx)
Parameter(N=2398)
Implicit Real*8(A-H,O-Z) 
Double Precision:: a(N),b(N),c(N),d(N) 
Common/Param_der_CsXe_gs/RderCsXe(N),EderCsXe(N),roderCsXe,EderCsXemax,rfderCsXe

If(xx.le.roderCsXe)Then
  V_der_CsXe_gs=EderCsXemax
  Return

Endif

if(xx.gt.rfderCsXe) then
V_der_CsXe_gs=EderCsXe(N)
Return
endif

Call spline2(RderCsXe,EderCsXe,a,b,c,d,0,0,N)
Call Findi2(RderCsXe,xx,N,ix)

V_der_CsXe_gs= a(ix) + (b(ix) + xx*(c(ix) + xx*d(ix)))*xx  

End


double precision function V_XeXe(dist,elem)

implicit none

real (kind=8),    parameter :: evk     = 11604.448    ! 1eV   = 11604.448  K
real (kind=8),    parameter :: bohr    = 0.529177249  ! 1Bohr = 0.529 \AA
real (kind=8),    parameter :: hartree = 27.211608    ! 1H    = 27.2  eV
real (kind=8),    parameter :: factor  = evk*hartree, conv_har_K=3.157750248040761d5

real      (kind=8), intent(IN) :: dist
character (len=3) , intent(IN) :: elem

character*3 celem(3)
real (kind=8) :: fpot,gpot,gfun,cutoffpos
real (kind=8) :: energy(3),Rm(3),sigma(3),C6(3),C8(3),C10(3),gamma(3),aval(3),bn(6),umaxoff(3)
real (kind=8) :: R0,innervariable
integer (kind=4) :: i,ielem


data bn /0.4430660275d0,0.9102270866d0,0.9134167883d0,0.3755556980d0,0.06817731538d0,0.00466047624d0 / !!! only for XC3

data celem      /  'XC1' ,      'XC2' ,    'XC3'  /
data energy    / 8.7167d4,    8.921691d4, 8.921691d4 /  !!! in hartree
data Rm       / 8.281093d0,   8.231039d0, 8.231039d0 / !!! in ao
data sigma    / 7.376840d0,   7.357578d0, 7.352901d0 / !!! in ao
data C6       / 288.7600d0,   287.3200d0, 287.3200d0 / !!! in ao**6
data C8      / 12979.80d0,    11294.60d0, 11294.60d0 / !!! in ao**8
data C10     / 675000.0d0,    674552.0d0, 674552.0d0 / !!! in ao**10
data gamma   / 1.484568d0,    2.056434d0, 2.056434d0 / !!! dimensionless
data aval    / 0.10d0,        0.028987d0, 0.028987d0 / !!! dimensionless
data umaxoff / 2272.6977d0,   2400.2415d0, 2615.2744d0 / !! in K


do ielem=1,4
 ! Write(6,*)"ieleme=",ielem,celem(ielem)
  if(ielem.eq.4) STOP 'From V_impur: This impurity does not exist'
  if(elem.ne.celem(ielem)) cycle
  exit
end do
 
 cutoffpos=6.462863157d0 !!in ao

 if(dist.le.cutoffpos)then
    V_XeXe=umaxoff(ielem)
  return
 endif

 if(ielem.eq.1 .OR. ielem.eq.2) then
    gpot=1d0
 else
   R0=7.2d0 !! in ao
   innervariable=0d0

    if(dist.lt.R0) then

      do i=0,5
        innervariable=innervariable+bn(i)*((dist-R0)**(i+2))/(1+(dist-R0)**2)
      enddo

      gpot=exp(-innervariable)
    else
     gpot=1d0
    endif

endif

  if(dist.lt.1.28d0*Rm(ielem))then
    fpot=exp(-0.4d0*(1.28d0*Rm(ielem)/dist-1d0)**2)
  else
    fpot=1d0
  endif

 V_XeXe=(gamma(ielem)*(1d0+aval(ielem)*dist)-1)*gpot*exp(-1.8032d0*dist+8.1274d0-5.4809d0/dist+1.1346/dist**2)-(C6(ielem)/dist**6+C8(ielem)/dist**8+C10(ielem)/dist**10)*fpot
 V_XeXe=V_XeXe*conv_har_K

End



double precision function V_Xe_Xe_2020(xx)
Implicit Real*8(A-H,O-Z)   

!!! Input xx in \AA
!!! Output V in K

!! Dimensionless parameters

real      (kind=8) :: Alpha1    = 10.343d0
real      (kind=8) :: Alpha2    = -23.687d0
real      (kind=8) :: Alpha3    = 12.343d0
real      (kind=8) :: Alpha     = 22.767d0
real      (kind=8) :: A         = 45.612d5
real      (kind=8) :: gamma     = 1.531d0
real      (kind=8) :: beta      = 15.485d0
real      (kind=8) :: b         = 13.950d0
real      (kind=8) :: C6        = 1.3499d0
real      (kind=8) :: C8        = 0.4147d0
real      (kind=8) :: C10       = 0.1716d0
real      (kind=8) :: Za        = 54d0 !  atomic number in au for Xe 
real      (kind=8) :: Zb        = 54d0 !  atomic number in au for Xe
real      (kind=8) :: Re        = 8.273d0!! au !!4.38d0 !  \AA
real      (kind=8) :: De        = 88.663d-5 ! Eh (au) !!279.97d0  K
real      (kind=8) :: R,xx       
Integer   (kind=4) :: K
real      (kind=8) :: sum,sum2       
real      (kind=8) :: Fact(0:10)
Real      (Kind=8) :: a_bohr= 0.529177d0  !!! Convert from \AA to au (bhor)
Real      (Kind=8) :: au_k= 3.1577502480407d5 !!! Convert from Eh (au) to K 

  Fact(0) = 1.d0; Fact(1) = 1.d0
  Do i=2, 10
    Fact(i) = Fact(i-1)*i
  EndDo

 R=(xx/a_bohr)/Re
! !R=(xx)/Re

Ushort=(1d0/R)*(1d0+Alpha1*R+Alpha2*R**2+Alpha3*R**3)*exp(-alpha*R)

sum=0d0
sum2=0d0

do i=3,5
   do k=0,2*i
      sum2=sum2+(b*R)**k/fact(k)
     ! Write(45,*)fact(k),k
    enddo
    
     sum2=1d0-exp(-b*R)*sum2
    
   
     if(i.eq.3)  sum2=sum2*C6/R**(2*i)
     if(i.eq.4)  sum2=sum2*C8/R**(2*i)
     if(i.eq.5)  sum2=sum2*C10/R**(2*i)

     sum=sum+sum2
     sum2=0d0

enddo
 

Uvdw=A*R**(gamma)*exp(-beta*R)-sum
Ulong=(1d0-exp(-alpha*R))*Uvdw

 V_Xe_Xe_2020 = (Za*Zb/Re)*Ushort+De*Ulong
 V_Xe_Xe_2020=V_Xe_Xe_2020*au_k  !!!! Potential in K


Return
End




double precision function V_Xe_Xe_2017(xx)
Implicit Real*8(A-H,O-Z)   

!!! Input xx in \AA
!!! Output V in K

!! Dimensionless parameters

real      (kind=8) :: A         = 0.579317071d8 !! K
real      (kind=8) :: a1        = -2.08311994d0 !! \AA **-1
real      (kind=8) :: a2        = -0.147746919d0 !! \AA **-2
real      (kind=8) :: an1       = -2.89687722d0 !! \AA
real      (kind=8) :: an2       = 2.58976595d0 !! \AA**2
real      (kind=8) :: b         = 2.44337880d0  !! \AA**-1
real      (kind=8) :: C_disp(3),C_disp_high(3)    
real      (kind=8) :: De        = 279.975d0 !  K
real      (kind=8) :: Re        = 4.37798d0 !  \AA
real      (kind=8) :: Fact(0:16)
Real      (Kind=8) :: a_bohr= 0.529177d0  !!! Convert from \AA to au (bhor)
Real      (Kind=8) :: au_k= 3.1577502480407d5 !!! Convert from Eh (au) to K 
Real      (Kind=8) :: Vfirst_term,Vsecond_term,sum,sum2,posroff,umaxoff


posroff=3.3499999d0 !!! rcutoff

  if(xx.le.posroff) then
   V_Xe_Xe_2017=0.30477436E+04
  
  Return
  endif

  Fact(0) = 1.d0; Fact(1) = 1.d0
  Do i=2, 16
    Fact(i) = Fact(i-1)*i
  EndDo

data C_disp / 0.200298034d7,0.199130481d8 ,0.286841040d9 / !!! C6,C8,C10 (K*\AA**6,K*\AA**8,K*\AA**10)

!!! C_disp_high(3)  it's going to contain C12,C14 and C16 coeffcients
C_disp_high=0d0

Vfirst_term=A*exp(a1*xx+a2*(xx**2)+an1/xx+an2/xx**2)

Vsecond_term=0d0
sum2=0d0

do i=3,8
  
  sum=0d0

  do k=0,2*i
     sum=sum+(b*xx)**k/fact(k)
  enddo

  if(i.le.5)then
     sum2=(C_disp(i-2)/xx**(2*i))
  else

     if(i.eq.6)  C_disp_high(1)=C_disp(1)*(C_disp(3)/C_disp(2))**3 
     if(i.eq.7)  C_disp_high(2)=C_disp(2)*(C_disp_high(1)/C_disp(3))**3 
     if(i.eq.8)  C_disp_high(3)=C_disp(3)*(C_disp_high(2)/C_disp_high(1))**3 
     
    sum2=(C_disp_high(i-5)/xx**(2*i))
  endif
  
Vsecond_term=Vsecond_term+sum2*(1d0-exp(-b*xx)*sum)
enddo


 V_Xe_Xe_2017 = Vfirst_term-Vsecond_term
 

Return
End




